import react from 'react';
import React, { useState, useEffect } from 'react';

export default function SignUp() {

  useEffect(() => {
      document.title = "Sign-Up";
  })

  return (
    <div>
      <h1 className='sign-up'> Sign-Up page </h1>
    </div>
  );
}
